import React, {useContext, useState} from 'react';
import {observer} from "mobx-react-lite";
import {Context} from "../index";
import {Row} from "react-bootstrap";
import OrderItem from "./OrderItem";
import {useNavigate} from "react-router-dom";
import {ORDER_ROUTE} from "../utils";

const OrderList = observer( ({filteredOrders,showFilteredOrders}) => {
    const {order} = useContext(Context)
    const navigate = useNavigate()



    return (
        <Row className="d-flex mt-5" >

            {showFilteredOrders
                ?filteredOrders.length !==0
                    ? filteredOrders.map(orderCur =>
                    <div
                        key={orderCur.id}
                        onClick={() => navigate(ORDER_ROUTE + '/' + orderCur.id)}
                        style={{cursor:"pointer"}}
                    >
                        <OrderItem
                            orderCur={orderCur}
                        />
                    </div>)
                    :<h2>Замовлень не знайдено</h2>
            :order.orders.map(orderCur =>
                <div
                    key={orderCur.id}
                    onClick={() => navigate(ORDER_ROUTE + '/' + orderCur.id)}
                    style={{cursor:"pointer"}}
                >
                    <OrderItem
                        orderCur={orderCur}
                    />
                </div>

            )}

        </Row>

    );
});

export default OrderList;
